We stocked our Southern Illinois farm pond with 8" channel catfish in 2017, but we've had several otters spend winter time there and we lost a lot of fish to the otters. We also had a bad winter freeze one year while the pond levels were low. We've been trying to catch a channel catfish for the last several years but to no avail.. Until today that is!  Join me on our Southern Illininois farm pond as I finally latch on to a very BIG fish! I've been bass fishing our farm pond all summer and taking dozens of hours of GoPro video footage only to catch a bunch of small largemouth bass. But today that will finally change! It was a beautiful, sunny and quiet evening on our Southern Illinois farm so I decided to do some bass fishing. But tonight I tied on a large Rapala bait so as to try to reduced the 'dinker bass' from biting it. And the plan worked as I was rewarded with a monster size channel catfish! Also I got a few decent bass as well, but the experience was awesome, and I am glad that I could share it with all of you! So join us as the fishing action results the 6 year old question as to whether or not we have big channel cats on our farm pond!  Thanks for joining us today at Kapper Outdoors Modern Homestead, if you enjoyed the video please leave us a like and consider subscribing to follow along with all of our country livning adventures, land management projects, our vrbo cabin build, excavation projects and of course all of Sharon's DIY rustic red cedar and barnwood projects. Also check out our 2nd channel which is pure land management & land improvement projects, land excavation projects, wildlife habitat improvement projects, KIOTI tractor projects, bobcat mini excavator projects and more: 
